import "./Nav.css"

class NavBar extends React.Component{
    render() {
      return (
        <nav>
            <img className="logo" src="AirborneWhite.png" alt="Airborne Logo" height="45"/>
            <ul>
                <li>Sponsorlar</li>
            </ul>
        </nav>
      )
    }
}

export default NavBar;
